import ReactPlayer from "react-player";
import "../styles/youtubePlayer.css"

function YoutubePlayer(props){

    if(!props.client){
        return (

            <div id="react-player">
                <ReactPlayer width="100%" height="100%" url={props.url} controls={true} playing={true} />
            </div>
            
        )
    }else{
        return (

            <div id="react-player">
                <ReactPlayer width="100%" height="100%" url={props.url} playing={true} />
            </div>
            
        )   
    }
}

export default YoutubePlayer;
